import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
const ServiceRecords = () => {
  const location = useLocation();
  const params = new URLSearchParams(location.search);
  const [service, setservice] = useState([]);
  const [car, setCar] = useState({})
  useEffect(() => {
    fetch(`http://65.0.15.177:5000/car/get/${params.get("id")}`)
      .then((response) => response.json())
      .then((json) => {
        setCar(json.car);
        setservice(json.Car.Servicing);
        console.log(car)
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="container">
      <h2>Service Record </h2>
      <div>
        <p>
            {/* Car Model : {car.model} <br /> */}
            {/* purchase Date : {car.purchase_date} */}
        </p>
      </div>
      <div className="row">
        <div className="col-md-3 my-1">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">XYZ</h5>
              <h6 className="card-subtitle mb-2 text-muted">ABC</h6>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ServiceRecords;
